package main

import (
	"bytes"
	"encoding/base64"
	"fmt"
	"image/jpeg"
	"log"
	"os"
	"testing"
)

func init() {
	testing.Init()
}

type UploadImageReq struct {
	ImageList []string `json:"image_list"`
}

func main() {
	req := &UploadImageReq{}
	req.ImageList = []string{getBase64()}

	for _, imageRawBase64 := range req.ImageList {
		fileType := ""
		switch imageRawBase64[11] {
		case 'p':
			fileType = "png"
		case 'j':
			fileType = "jpg"
		default:
			log.Fatalf("unknown type file:%v", imageRawBase64[11:15])
		}
		iIndex := 0
		// find comma index
		for i := 0; i < len(imageRawBase64); i++ {
			if imageRawBase64[i] == ',' {
				iIndex = i
				break
			}
		}

		dec, err := base64.StdEncoding.DecodeString(imageRawBase64[iIndex+1:])
		imReder := bytes.NewReader(dec)
		im, err := jpeg.Decode(imReder)
		f, err := os.OpenFile("example."+fileType, os.O_WRONLY|os.O_CREATE, 0777)
		if err != nil {
			panic("Cannot open file")
		}
		err = jpeg.Encode(f, im, nil)
		if err != nil {
			fmt.Println(err)
		}
	}
}
func getBase64() string {
	return "data:image/jpeg;base64,"
}
